import React from "react";
import ReactDOM from "react-dom";


/// class based component
class App extends React.Component {

    constructor(props) {
        super(props)

        this.state = { latitude: null}
    }

    render() { 

        return(
            <div>
                { this.state.latitude }
            </div>
        )
    }
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
